import React, { useState } from 'react';
import { Alerta } from '../components/Alert';
import {
    ChakraProvider,
    AlertDialog,
    AlertDialogOverlay,
    AlertDialogContent,
    AlertDialogHeader,
    AlertDialogBody,
    AlertDialogFooter,
    Button,
} from '@chakra-ui/react';

interface userLogin {
    email: string
    password: string
}

export const login_function = ({ email, password }: userLogin): JSX.Element => {
    const [isAlertOpen, setIsAlertOpen] = useState<boolean>(true);

    const onClose = () => {
        setIsAlertOpen(false);
    };

    alert(`Email: ${email}, Password: ${password}`);
    return (
        <ChakraProvider>
            <AlertDialog isOpen={isAlertOpen} onClose={onClose}>
                <AlertDialogOverlay>
                    <AlertDialogContent>
                        <AlertDialogHeader>Alerta</AlertDialogHeader>
                        <AlertDialogBody>
                            <Alerta email={email} password={password} />
                        </AlertDialogBody>
                        <AlertDialogFooter>
                            <Button colorScheme="blue" onClick={onClose}>
                                OK
                            </Button>
                        </AlertDialogFooter>
                    </AlertDialogContent>
                </AlertDialogOverlay>
            </AlertDialog>
        </ChakraProvider>
    );
}
